css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #6c6c6d;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid hsl(230, 1%, 86%);
  background-color: hsl(230, 1%, 92%);
}
.github-tab-icon {
  color: #b3b3b3;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: 0.4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #d8d8d9;
  border-radius: 3px;
  padding: 0 0.25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: hsl(230, 1%, 2%);
  box-shadow: 0 1px 0 #5871ef;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: hsl(230, 1%, 26%);
}
